import React from 'react';
import ProfileInfo from '../molecules/ProfileInfo';
import ProfileEdit from '../molecules/ProfileEdit';

interface ProfileCardProps {
  user: {
    name: string;
    age: number;
    weight: number;
    goal: string;
    avatarSrc?: string;
  };
}

const ProfileCard: React.FC<ProfileCardProps> = ({ user }) => (
  <div style={{ maxWidth: 400, margin: '0 auto', padding: 24, borderRadius: 16, boxShadow: '0 2px 8px #ccc', background: '#fff' }}>
    <ProfileInfo name={user.name} age={user.age} weight={user.weight} goal={user.goal} />
    <ProfileEdit initialWeight={user.weight} initialGoal={user.goal} avatarSrc={user.avatarSrc} />
  </div>
);

export default ProfileCard;
